import createLucideIcon from '../createLucideIcon';

/**
 * @component @name StretchHorizontal
 * @description Lucide SVG icon component, renders SVG Element with children.
 *
 * @preview ![img](data:image/svg+xml;base64,) - https://lucide.dev/icons/stretch-horizontal
 * @see https://lucide.dev/guide/packages/lucide-react - Documentation
 *
 * @param {Object} props - Lucide icons props and any valid SVG attribute
 * @returns {JSX.Element} JSX Element
 *
 */
const StretchHorizontal = createLucideIcon('StretchHorizontal', [
  [
    'rect',
    { width: '20', height: '6', x: '2', y: '4', rx: '2', key: 'qdearl' },
  ],
  [
    'rect',
    { width: '20', height: '6', x: '2', y: '14', rx: '2', key: '1xrn6j' },
  ],
]);

export default StretchHorizontal;
